import { NavLink } from "react-router-dom";


const NavBar = () => {
    return (
        <div>
            <p>blog.app</p>
            <ul>
                <li> <NavLink to="/">
                     Home 
                     </NavLink>
                </li>
                <li> <NavLink to="/about">
                     About 
                     </NavLink>
                </li>
            </ul>
        </div>

    )
}

export default NavBar;
